const CardView = () => {


    const [data , setData] = useState([])

    useEffect(() => {

        axios
        .get("https://api.themoviedb.org/3/movie/popular?api_key=2e5d307a9142003b321ca6029b44fe63")
        .then((res)=>{

            setData(res.data.results);
        })
        .catch((err)=>{
            console.log(err);
        })

    },[])



return (
    <>


{console.log(data.results)}
<Container>

<Row xs={1} md={3} className="g-4">
{data.map((resdata) => {

 <ul><li key={resdata.id}>{resdata.title}</li></ul>  

